import React from "react";

const MemeCard = (props) => {
  const { post } = props;

  return (
    <div>
      <div>
        <h4>{post.title}</h4>
        <h4>{post.category}</h4>
      </div>
      <div>
        {post.content.split(".").pop() == "mp4" || "ogg" || "webm" ? (
          <video src={post.content} controls />
        ) : (
          <img src={post.content} />
        )}
      </div>
    </div>
  );
};

const styles = {};

export default MemeCard;
